import React from "react";

const User = () => {
  return (
    <div className="container-fluid">
      <div className="row">
        <div
          className="col-9 border border-primary"
          style={{ height: "100px" }}
        >
          user preference
        </div>
        <div className="col-3 border border-primary">user data</div>
      </div>
    </div>
  );
};

export default User;
